import { BrowserRouter, Link } from "react-router-dom";
import "./App.css";

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <div>
          <Link to="/adminPage">Admin</Link>
        </div>
        <div>
          <Link to="/userPage">User</Link>
        </div>
      </div>
    </BrowserRouter>
  );
}

export default App;
